import React from "react";
import { Cloudinary } from "@cloudinary/url-gen";
import { backgroundRemoval } from "@cloudinary/url-gen/actions/effect";

const ClothingImageCard = ({ clothingType, image }) => {

    const cld = new Cloudinary({
    cloud: {
      cloudName: "dmjzidsiy",
    },
  });

    let transformedImage = null;
  if (image) {
    tImage = cld
      .image(image.replace(/^.*\/upload\//, "")) // take public ID out of full URL
      .effect(backgroundRemoval())              // apply remove bg
      .toURL();                                 // create usable image URL
  }

  return (
    <div className="clothing-card">
      <h3>{clothingType}</h3>
      {image && (
        <img src={image} alt={clothingType} style={{ width: "200px" }} />
      )}
      .effect(backgroundRemoval());
    </div>
  );
};

export default ClothingImageCard;
